    false,nt"url": null,nt"notes": "A small population of gopher tortoises
    Gopherus polyphemus exists on St. Vincent Island. Staff reports that the population
    has been augmented several times throughout the years from mainland populations.
    The tortoise use area is  located along the southeast corner of the island Figure
    1. Habitat management for the tortoise includes stimulating the growth of grasses
    and herbs in tortoise use areas with biannual prescribed burning. On 2 February
    1993 a prescription burn was conducted in the tortoise use areas. A total of 464
    acres were surveyed. Thirtytwo tortoise burrows were flagged and only two were determined
    to be active. Gopher tortoise burrows were located in various locations on each
    dune ridge from the first vegetated dune inland from the beach to B Road.",nt"license_title":
